// If secondary navbar menu is used, find and set class of the <li> containing the "Donate" link
jQuery(document).ready(function () {
//	var sec_menu = jQuery('#block-menu-menu-secondary-nav-bar-menu li');
	var sec_menu = jQuery('.m-secondary-navigation li, .secondary-navigation li');
	if (sec_menu) {
//		sec_menu.each(function(idx, li) {
//			var item = jQuery(li);
//			// other code here...
//		});
		sec_menu.each(function() {
			if (jQuery('a', this).html().includes('Donate')) jQuery(this).addClass('donate-button');
		});
	}
});
